window.bookSummaryJSON = "<p><b>\"Even nonfantasy listeners will enjoy hanging out at the intersection of coffeehouse culture and Dungeons &amp; Dragons, and hope that Baldree fails to shake his new writing habit.\" - </b><b><i>The Seattle Times</i></b><b> </b><br> <b><br> This program is read by the author.<br> <br> The much-beloved BookTok sensation, Travis Baldree's </b><b><i>Legends &amp; Lattes</i></b><b>, is novel of high fantasy and low stakes.<br> <br> Come take a load off at Viv's cafe, the first &amp; only coffee shop in Thune. Grand opening!</b><br> <br> Worn out after decades of packing steel and raising hell, Viv, the orc barbarian, cashes out of the warrior’s life with one final score. A forgotten legend, a fabled artifact, and an unreasonable amount of hope lead her to the streets of Thune, where she plans to open the first coffee shop the city has ever seen.<br> <br> However, her dreams of a fresh start filling mugs instead of swinging swords are hardly a sure bet. Old frenemies and Thune’s shady underbelly may just upset her plans. To finally build something that will last, Viv will need some new partners, and a different kind of resolve.<br> <br> <b>A hot cup of fantasy, slice-of-life with a dollop of romantic froth.<br> <br> A Macmillan Audio production from Tor Books.</b></p>"; 
